// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    // Address of the contract administrator
    address public admin;

    // Timestamp representing the voting end date
    uint256 public endDate;

    // Structure to store candidate information
    struct Candidate {
        uint256 id;
        string name;
        uint256 voteCount;
    }

    // Mapping of candidate IDs to candidate structs
    mapping(uint256 => Candidate) public candidates;

    // Mapping of addresses to voting status (true if voted)
    mapping(address => bool) public voters;

    // Modifier to restrict functions to the contract administrator
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this operation");
        _;
    }

    // Constructor to set the administrator and end date
    constructor(uint256 _endDate) {
        admin = msg.sender;
        endDate = _endDate;
    }

    // Function to add a candidate by the administrator
    function addCandidate(string memory _name) public onlyAdmin {
        uint256 candidateId = uint256(keccak256(abi.encodePacked(block.timestamp, _name)));
        candidates[candidateId] = Candidate(candidateId, _name, 0);
    }

    // Function to cast a vote for a candidate
    function vote(uint256 _candidateId) public {
        require(block.timestamp < endDate, "Voting has ended");
        require(candidates[_candidateId].id != 0, "Invalid candidate");
        require(!voters[msg.sender], "You have already voted");

        candidates[_candidateId].voteCount++;
        voters[msg.sender] = true;
    }

    // Function to determine the winner after voting has ended
    function getWinner() public view returns (string memory) {
        require(block.timestamp >= endDate, "Voting has not ended yet");

        uint256 maxVoteCount = 0;
        string memory winnerName;

        // Iterate through each candidate in the mapping
        for (uint256 i = 0; i < 10; i++){
            uint256 candidateId = i;
            Candidate memory candidate = candidates[candidateId];
            if (candidate.voteCount > maxVoteCount) {
                maxVoteCount = candidate.voteCount;
                winnerName = candidate.name;
            }
        }

        return winnerName;
    }
}
